              'DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><b style="color: rgb(48, 51, 53); font-family: &quot;Open Sans&quot;, sans-serif; word-spacing: 0px;">Дверное полотно</b><span style="color: rgb(48, 51, 53); font-family: &quot;Open Sans&quot;, sans-serif; word-spacing: 0px;">&nbsp;-&nbsp;каркас полотна изготовлен с применением сращенного бруса хвойных пород древесины;</span></p><p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><b style="color: rgb(48, 51, 53); font-family: &quot;Open Sans&quot;, sans-serif;">Дверная&nbsp;коробка</b><span style="color: rgb(48, 51, 53); font-family: &quot;Open Sans&quot;, sans-serif;">&nbsp;- алюминиевая (скрытого монтажа);&nbsp;</span></p><p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><b style="color: rgb(48, 51, 53); font-family: &quot;Open Sans&quot;, sans-serif;">Отделка полотна</b><span style="color: rgb(48, 51, 53); font-family: &quot;Open Sans&quot;, sans-serif;">&nbsp;- грунтованное полотно (для последующей окраски или наклейки обоев); шпон; многоуровневая покраска (цвет по выбору каталога RAL); пластик HPL.;&nbsp;</span></p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Отделка&nbsp;коробки</b>&nbsp;- полимерное покрытие в цвете RAL;</p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Заполнение полотна</b>&nbsp;- ДСП, МДФ;</p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Толщина полотна</b>&nbsp;- 40 мм;</p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Фурнитура</b>&nbsp;- магнитный замок, скрытые петли;</p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Звукоизоляция</b>&nbsp;- 25 dB (класс А).</p><br>',
