              'DESCRIPTION' => '<p class="margin-bottom-30" style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><br></p><p style="color: rgb(48, 48, 48); font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 0.6px;">Дверной блок можно скомпоновать согласно требованиям вашего ТЗ.</p><p style="color: rgb(48, 48, 48); font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 0.6px;">– Полотно деревянное, покрытое пластиком HPL/CPL толщиной от 0,6 до 1 мм,</p><p style="color: rgb(48, 48, 48); font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 0.6px;">Варианты исполнения полотен:</p><p style="color: rgb(48, 48, 48); font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 0.6px;">* Перфорированное или цельное ДСП,<br>* ДВП(TOP-ROOM),<br>* Специальная противопожарная плита ДСП с разнонаправленными волокнами<br>и огнезащитной пропиткой в исполнении(EI30;EI60)<br>* В рентгенозащитном исполнение со свинцовым эквивалентом от 0,5 до 3мм.</p><p style="color: rgb(48, 48, 48); font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 0.6px;">Все типы дверных полотен предлагаются в глухом или остекленном исполнение.<br>В стандартную комплектацию входят: петли, замок, ручка, цилиндр.</p><p style="color: rgb(48, 48, 48); font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 0.6px;">Дополнительные элементы для полотен.<br>– Отбойные пластины различного размера (нерж. сталь 0,8мм.)<br>– Доводчики.<br>– Замки с функцией «Антипаника».<br>– Системы автоматического открывания.<br>– Системы СКУД.</p><p style="color: rgb(48, 48, 48); font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 0.6px;">Варианты исполнения коробок:</p><p style="color: rgb(48, 48, 48); font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 0.6px;">* Металлическая, цельносварная из оцинкованной стали 1,5мм, покрашенная по шкале RAL.<br>* Из нержавеющей стали, толщина 1,2 мм.</p><p style="color: rgb(48, 48, 48); font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 0.6px;">Модели коробок :<br>* Телескопическая (обжимная).<br>* Угловая.<br>* Угловая с обратным открыванием.<br>* Торцевая (вдвижная).</p><p style="color: rgb(48, 48, 48); font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 0.6px;">Дополнительные элементы для коробок.<br>– Стационарный порог.<br>– Исполнение «люк» (наличник с 4х сторон).<br>– Портал/обрамление проема</p><br>',
