ая (обжимная).<br>* Угловая.<br>* Угловая с обратным открыванием.<br>* Торцевая (вдвижная).</p><p style="color: rgb(48, 48, 48); font-family: Roboto, sans-serif; font-size: 14px; letter-spacing: 0.6px;">Дополнительные элементы для коробок.<br>– Стационарный порог.<br>– Исполнение «люк» (наличник с 4х сторон).<br>– Портал/обрамление проема</p><br>',
