              'SHORT_DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><span style="color: rgb(69, 74, 78); font-family: &quot;Basis Grotesque Pro&quot;; text-align: justify; word-spacing: 0px;">Цельностеклянная одинарная прозрачная дверь в комплекте с фурнитурой.</span><span style="color: rgb(69, 74, 78); font-family: &quot;Basis Grotesque Pro&quot;; text-align: justify; word-spacing: 0px;"><br></span><br>',
              'DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><span style="color: rgb(69, 74, 78); font-family: &quot;Basis Grotesque Pro&quot;; text-align: justify; word-spacing: 0px;">Цельностеклянная одинарная прозрачная дверь в комплекте с фурнитурой: фитинги нижний и верхний, нижний шарнир, ось верхняя, ручка труба 25x1000 мм. </span></p><p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><span style="color: rgb(69, 74, 78); font-family: &quot;Basis Grotesque Pro&quot;; text-align: justify; word-spacing: 0px;">Размер полотна: 2000х800 мм. </span></p><p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><span style="color: rgb(69, 74, 78); font-family: &quot;Basis Grotesque Pro&quot;; text-align: justify; word-spacing: 0px;">Цельностеклянный дверной блок может быть укомплектован разнообразными ручками, доводчиком.</span><br></p><br>',
