              'TITLE' => 'Двери для школ, офисов и других общественных помещений AL-003',
              'CODE' => 'AL-003',
              'SHORT_DESCRIPTION' => '<h4 style="padding: 0px; margin-bottom: 25px;">Легкие и прочные двери &nbsp;для школ, офисов и других общественных помещений</h4><p style="padding: 0px; margin-bottom: 25px;"><br><br>',
              'DESCRIPTION' => '<h1 class="pc-cd-name" itemprop="name" style="padding: 0px; font-size: 24px; margin-bottom: 25px; text-transform: uppercase; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, sans-serif;"><p style="padding: 0px; font-size: 14.0112px; margin-bottom: 10px; overflow-wrap: break-word; min-height: 1em; line-height: 19px; text-transform: none; font-family: Arial; color: rgb(34, 34, 34);">В образовательных и в других общественных помещениях к дверям прикасаются чаще, чем к каким-либо другим частям строительных конструкций. Двери должны быть легкими, прочными, гигиеничными, безопасными и простыми в использовании. Цельнолитая структура дверей и их гладкая поверхность, не собирающая грязь и бактерии, делает двери очень легко чистящимися, моющимися и долговечными. Двери &nbsp;выдерживают сильные дезинфицирующие и моющие средства. Легкий вес дверей делает их безопасными и простыми в использовании.</p></h1><br>',
