              'SHORT_DESCRIPTION' => '<h1 class="pc-cd-name" itemprop="name" style="padding: 0px; font-size: 24px; margin-bottom: 25px; text-transform: uppercase; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, sans-serif;">ДВЕРЬ В ФИТНЕС ЦЕНТРЫ, БАССЕЙНЫ, СПА И ДРУГИЕ ВЛАЖНЫЕ ПОМЕЩЕНИЯ</h1><p style="padding: 0px; font-size: 24px; margin-bottom: 25px; text-transform: uppercase; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, sans-serif;"><span style="color: rgb(0, 0, 0); font-family: arial; font-size: 14.0098px; text-transform: none;">Цельнолитые двери &nbsp;десятилетиями выдерживают постоянную влагу и воду.</span><br>',
              'DESCRIPTION' => '<p style="padding: 0px; font-size: 14.0112px; margin-bottom: 10px; overflow-wrap: break-word; min-height: 1em; line-height: 19px; font-family: Arial; color: rgb(34, 34, 34);">Двери в фитнес центрах, бассейнах, СПА и других влажных помещениях находятся под постоянным воздействием влаги и воды. Это устанавливает жесткие требования к дверям, которые будут использоваться в этих помещениях. Двери десятилетиями выдерживают постоянную влагу, хлорированную воду и моющие средства благодаря цельнолитой структуре полотна и гладкой "gelcoat" поверхности. Двери &nbsp;не гниют, не ржавеют, не разбухают и не деформируются даже после многолетнего использования.</p><p style="padding: 0px; font-size: 14.0112px; margin-bottom: 10px; overflow-wrap: break-word; min-height: 1em; line-height: 19px; font-family: Arial; color: rgb(34, 34, 34);"><span style="font-size: 14.0112px;">Дизайн часто выходит на первый план при строительстве фитнес центров, плавательных бассейнов и СПА. Широкая цветовая гамма, аксессуары, остекление и т. д. подчеркнут индивидуальный дизайн дверей. Не зависимо от стиля или дизайна все двери являются высококачественными и долговечными.</span><br></p><br>',
