              'SHORT_DESCRIPTION' => '<ol style="color: rgb(128, 128, 128); font-family: osl, Arial, Helvetica, sans-serif; font-size: 17px;"><li>Рамная часть изготавливается из ценных&nbsp;пород дерева.</li></ol><p><br><br>',
              'DESCRIPTION' => '<ol style="color: rgb(128, 128, 128); font-family: osl, Arial, Helvetica, sans-serif; font-size: 17px;"><li>В качестве наполнителя полотна применяются две плиты ДСП толщиной 16 м.&nbsp;Две плиты МДФ толщиной 4 мм.</li><li>Материал покрытия полотна – пластик CPL/HPL толщиной 0,6 – 1 мм.</li></ol><ul style="color: rgb(128, 128, 128); font-family: osl, Arial, Helvetica, sans-serif; font-size: 17px;"><li>Торец полотна может быть без четверти. Вес полотна составляет около 25 кг. Толщина 42 мм. Индекс изоляции воздушного шума Rw=27 дБ. Телескопическая обжимная &nbsp;коробка предназначена для всех типов стен толщиной от 70 мм. Имеет возможность регулировки по толщине стены до 200 мм. После ее установки доработка монтажных зазоров не требуется (устанавливается после чистовой отделки помещения). Коробка герметичная производятся из электролитически оцинкованной стали толщиной 1,5 мм (окрашивается методом полимерного покрытия в любой цвет по каталогу RAL) либо из нержавеющей стали толщиной 1,25 мм (шлифованная, зеркальная и матовая поверхности). Каждая коробка комплектуется уплотнителем, вдавливаемым в углубление профиля.</li></ul><br>',
