          array (
            0 => 
            array (
              'LINK' => 'https://dverprom.by/katalog/dveri-dlya-pomeshcheny/dveri-v-palaty/med-003-palatnaya-dvustvorchataya.html',
              'ALIAS' => 'med-003-palatnaya-dvustvorchataya',
              'TITLE' => 'Палатные двери двустворчатые MED 003',
              'CODE' => 'MED 003 Палатная двустворчатая',
              'SHORT_DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><span style="color: rgb(128, 128, 128); font-family: osl, Arial, Helvetica, sans-serif; font-size: 17px; word-spacing: 0px; background-color: rgb(246, 246, 246);">ДВЕРИ ПАЛАТНЫЕ ДВУСТВОРЧАТЫЕ</span><br>',
              'DESCRIPTION' => '<div class="name" style="font-family: osl; font-size: 23px; text-transform: uppercase; padding: 0px 0px 30px;">ТИП ПОЛОТНА R</div><div class="body" style="font-size: 17px; color: rgb(128, 128, 128); padding: 0px 0px 46px; font-family: osl, Arial, Helvetica, sans-serif;"><ol><li>Рамная часть изготавливается из ценных&nbsp;пород дерева.</li><li>В качестве наполнителя полотна применяются две плиты ДСП толщиной 16 м.&nbsp;Две плиты МДФ толщиной 4 мм.</li><li>Материал покрытия полотна – пластик CPL/HPL толщиной 0,6 – 1 мм.</li></ol><ul><li>Торец полотна может быть без четверти.</li><li>Вес полотна составляет около 25 кг.</li><li>Толщина 42 мм.</li><li>Индекс изоляции воздушного шума Rw=27 дБ</li><li>Остекленное со стороны ручки полотна. Стандартный размер стекла – 1400х250мм.</li><li><p style="margin-bottom: 0px; background-color: rgb(242, 242, 242);">Телескопическая обжимная &nbsp;коробка предназначена для всех типов стен толщиной от 70 мм. Имеет возможность регулировки по толщине стены до 200 мм. После ее установки доработка монтажных зазоров не требуется (устанавливается после чистовой отделки помещения).</p><p style="margin-bottom: 0px; background-color: rgb(242, 242, 242);">Коробка герметичная производятся из электролитически оцинкованной стали толщиной 1,5 мм (окрашивается методом полимерного покрытия в любой цвет по каталогу RAL) либо из нержавеющей стали толщиной 1,25 мм (шлифованная, зеркальная и матовая поверхности). Каждая коробка комплектуется уплотнителем, вдавливаемым в углубление профиля.</p></li></ul></div><br>',
              'IMAGES' => 
              array (
                0 => 'images/dveri-dlya-pomeshcheny/med0035-380x380.jpg',
              ),
            ),
            1 => 
            array (
              'LINK' => 'https://dverprom.by/katalog/dveri-dlya-pomeshcheny/dveri-v-palaty/med-21-meditsinskaya-gluhaya.html',
              'ALIAS' => 'med-21-meditsinskaya-gluhaya',
              'TITLE' => 'Медицинские двери глухие MED 21',
              'CODE' => 'MED 21 ',
              'SHORT_DESCRIPTION' => '<p style="max-height: 999999px; padding: 0px; margin-bottom: 1.0625rem; color: rgb(75, 79, 88); font-family: Tahoma, &quot;Helvetica Neue&quot;, Helvetica, Geneva, Arial, sans-serif; font-size: 14px;">Межкомнатная пластиковая дверь из коллекции гладкая цвета RAL.<br>',
              'DESCRIPTION' => '<p style="max-height: 999999px; padding: 0px; margin-bottom: 1.0625rem; color: rgb(75, 79, 88); font-family: Tahoma, &quot;Helvetica Neue&quot;, Helvetica, Geneva, Arial, sans-serif; font-size: 14px;">В комплект входит: дверное полотно, с заводской зарезкой под замок, дверная коробка, зарезанная и собранная в размер полотна, наличники с 2-х сторон.</p><p style="max-height: 999999px; padding: 0px; margin-bottom: 1.0625rem; color: rgb(75, 79, 88); font-family: Tahoma, &quot;Helvetica Neue&quot;, Helvetica, Geneva, Arial, sans-serif; font-size: 14px;">Двери&nbsp; опционально могут поставляться с алюминиевым порогом, с отбойной пластиной, с усилением под доводчик,&nbsp;под двери на раздвижном механизме,&nbsp;под ручку скобу,&nbsp;под ручку антипанику, с&nbsp;отверстием под вентиляционную&nbsp;решетку.</p><p style="max-height: 999999px; padding: 0px; margin-bottom: 1.0625rem; color: rgb(75, 79, 88); font-family: Tahoma, &quot;Helvetica Neue&quot;, Helvetica, Geneva, Arial, sans-serif; font-size: 14px;">Цена за полотно распространяется на следующие стандартные размеры (мм): 600*2000, 700*2000, 800*2000, 900*2000.&nbsp;Также возможно изготовление&nbsp;скрытых дверей нестандартных размеров, по ширине от 200 мм до 1000 мм и по высоте от 500 мм до 2300 мм. Стоимость дверей Капель нестандартных размеров&nbsp;рассчитывается индивидуально.</p><br>',
