              'DESCRIPTION' => '<p style="max-height: 999999px; padding: 0px; margin-bottom: 1.0625rem; color: rgb(75, 79, 88); font-family: Tahoma, &quot;Helvetica Neue&quot;, Helvetica, Geneva, Arial, sans-serif; font-size: 14px;">В комплект входит: дверное полотно, с заводской зарезкой под замок, дверная коробка, зарезанная и собранная в размер полотна, наличники с 2-х сторон.</p><p style="max-height: 999999px; padding: 0px; margin-bottom: 1.0625rem; color: rgb(75, 79, 88); font-family: Tahoma, &quot;Helvetica Neue&quot;, Helvetica, Geneva, Arial, sans-serif; font-size: 14px;">Двери&nbsp; опционально могут поставляться с алюминиевым порогом, с отбойной пластиной, с усилением под доводчик,&nbsp;под двери на раздвижном механизме,&nbsp;под ручку скобу,&nbsp;под ручку антипанику, с&nbsp;отверстием под вентиляционную&nbsp;решетку.</p><p style="max-height: 999999px; padding: 0px; margin-bottom: 1.0625rem; color: rgb(75, 79, 88); font-family: Tahoma, &quot;Helvetica Neue&quot;, Helvetica, Geneva, Arial, sans-serif; font-size: 14px;">Цена за полотно распространяется на следующие стандартные размеры (мм): 600*2000, 700*2000, 800*2000, 900*2000.&nbsp;Также возможно изготовление&nbsp;скрытых дверей нестандартных размеров, по ширине от 200 мм до 1000 мм и по высоте от 500 мм до 2300 мм. Стоимость дверей Капель нестандартных размеров&nbsp;рассчитывается индивидуально.</p><br>',
