 baseline;">Тип покрытия —&nbsp;</strong>ПУ Эмаль</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Декор/Особенности:&nbsp;</strong>Фрезеровка по МДФ 8мм</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Каркас полотна: массив</strong>&nbsp;сосны + МДФ подложка</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Коробка:&nbsp;</strong>Телескопическая, прямая сендвич,&nbsp; с уплотнителем&nbsp; 2100*75*33 мм</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Наличник:&nbsp;</strong>Телескопический, канелюр, мдф, 2150*70*10 мм</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Добор:&nbsp;</strong>Телескопический,&nbsp; 2070*10*100 мм,&nbsp;2070*10*150 мм</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Розетка :&nbsp;</strong>70 х 10 х 70 мм</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Подпятник:&nbsp;</strong>&nbsp;70 х 10 х 200</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Притворная планка:&nbsp;</strong>2100*35*10 мм</p><br>',
