              'SHORT_DESCRIPTION' => '<p><span style="color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Arial, helvetica, sans-serif; font-size: 14px;">Дверное полотно из массива сосны. </span><br>',
              'DESCRIPTION' => '<p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PT Sans&quot;, sans-serif; vertical-align: baseline; color: rgb(102, 51, 51); letter-spacing: 0.4px;"><br style="margin: 0px; padding: 0px;">Размеры: 600-700-800-900<br style="margin: 0px; padding: 0px;">Материал: сосны</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PT Sans&quot;, sans-serif; vertical-align: baseline; color: rgb(102, 51, 51); letter-spacing: 0.4px;">Цвет: Махагон, венге, орех античный</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PT Sans&quot;, sans-serif; vertical-align: baseline; color: rgb(102, 51, 51); letter-spacing: 0.4px;"><br></p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;PT Sans&quot;, sans-serif; vertical-align: baseline; color: rgb(102, 51, 51); letter-spacing: 0.4px;">Натуральное дерево – живой материал. При изменении температурного и влажного режима оно расширяется или сужается. Это одновременно недостаток и достоинство дверей из массива.</p><br>',
