              'TITLE' => 'Двери &quot;Фелина 05&quot;',
              'CODE' => 'Фелина 05',
              'SHORT_DESCRIPTION' => '<p><span style="font-size: 13.0489px; orphans: 3; widows: 3;">Двери выполнены из массива дерева покрытый натуральным шпоном. Классическая линейка с объёмными филенками и багетным рамками предают моделям изысканные очертания.&nbsp;</span><span style="font-size: 13.0489px; orphans: 3; widows: 3;">Двери гармонично сочетают в себе природную красоту дерева и изящный стиль, высокий уровень качества и инновационные технологии производства, а также доступный уровень цен</span><br>',
              'DESCRIPTION' => '<p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Тип полотна :&nbsp;</strong>Глухое , со стеклом</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Цвет :&nbsp;</strong>ясень айсберг, красное дерево, дуб, бисквит, слоновая кость</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Стандартная высота и ширина:&nbsp;</strong>1900/550, 1900/2000,&nbsp; 2000/600, 2000/7000, 2000/800, 2000/900</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Толщина полотна —&nbsp;</strong>38 мм</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Отделка:&nbsp;</strong>натуральный шпон</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Тип покрытия —&nbsp;</strong>Полиуретановая эмаль + акриловый лак (1 слой эмали, 1 слой лака) для ясень</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Декор/Особенности:&nbsp;</strong>Багетная рамка- массив березы; покрытие в цвет полотна</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Каркас полотна:&nbsp;</strong>Брус сосны</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Коробка:&nbsp;</strong>Телескопическая, прямая сендвич,&nbsp; с уплотнителем&nbsp; 2100*75*33 мм</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Наличник:&nbsp;</strong>Телескопический, канелюр, мдф, 2150*70*10 мм</p><p style="margin-bottom: 1.618em; padding: 0px; border: 0px; font-size: 13.0489px; vertical-align: baseline; -webkit-hyphenate-character: &quot;‐&quot;; orphans: 3; widows: 3;"><strong style="margin: 0px; padding: 0px; border: 0px; font-size: 12.9184px; vertical-align: baseline;">Добор:&nbsp;</strong>Телескопический,&nbsp; 2070*10*100 мм,&nbsp;2070*10*150 мм</p><p style="margin-bottom: 1.618em; padding: 0px; 