              'DESCRIPTION' => '<p class="rtejustify" style="margin-top: 7px; margin-bottom: 7px; text-align: justify; line-height: 24px; font-size: 15px; outline: none !important;">Комплектом алюминиевых дверей в подъезд или общественное здание можно перекрыть пространство входа различных размеров. Конструкция достаточно прочная и надежная.&nbsp;Комплекты из наружных алюминиевых дверей могут стать входом в здания различного назначения. Она является долговечной, не подвержена к воздействию солнечных лучей, а так же осадков&nbsp;и холода. Благодаря специальной термовставке профиль не пропускает холод, сохраняя тепло&nbsp;в помещении.</p><p class="rtejustify" style="margin-top: 7px; margin-bottom: 7px; text-align: justify; line-height: 24px; font-size: 15px; outline: none !important;">Для алюминиевых дверей характерна монтажная толщина профиля 3-х камерной рамы –&nbsp;<strong style="outline: none !important;">62 мм</strong>. Возможны вставки стеклопакетов толщиной<strong style="outline: none !important;">&nbsp;от 20 мм&nbsp;</strong>и выше.</p><ul class="har" style="margin-right: 0px; margin-bottom: 24px; margin-left: 0px; padding: 0px; columns: 270px 3; list-style: none; font-size: 15px; outline: none !important;"><li style="outline: none !important; padding: 0px; margin: 0px; height: 24px;"><div class="field field-name-field-razm field-type-computed field-label-inline clearfix" style="line-height: 24px; color: rgb(35, 35, 33); display: inline-block; outline: none !important;"><div class="field-label" style="outline: none !important; font-weight: bold; float: left;">Размер:&nbsp;</div><div class="field-items" style="outline: none !important; float: left;"><div class="field-item even" style="outline: none !important;">1300x2100</div></div></div></li><li style="outline: none !important; padding: 0px; margin: 0px; height: 24px;"><div class="field field-name-field-tolshina field-type-taxonomy-term-reference field-label-inline clearfix" style="line-height: 24px; color: rg