              'SHORT_DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><i style="color: rgb(48, 51, 53); font-family: &quot;Open Sans&quot;, sans-serif; word-spacing: 0px;">Оптимальное соотношение цены и качества</i><i style="color: rgb(48, 51, 53); font-family: &quot;Open Sans&quot;, sans-serif; word-spacing: 0px;">.</i><br>',
              'DESCRIPTION' => '<p style="margin: 8px auto; font-family: Verdana, &quot;Open Sans&quot;, Geneva, sans-serif; font-size: 14px; background-color: rgb(246, 246, 246);">Конструкция дверного блока данной модели предполагает монтаж в проёмы шириной не менее 1100&nbsp;мм. Типичными местами установки являются входы в подъезды многоквартирных домов, а также другие здания, где функциональность изделия играет более существенную роль, чем изоляционные качества. В течение всего периода эксплуатации железные&nbsp;<font color="#0c8ba5"><span style="transition-duration: 0.3s; transition-property: color;">входные двери в подъезд</span></font>&nbsp;подвергаются воздействию осадков и низких температур. Поэтому с целью защиты от ржавчины и сохранения внешнего вида, дверь №&nbsp;4 покрывают качественной порошковой краской. Цвет покрытия выбирает заказчик.</p><p style="margin: 8px auto; font-family: Verdana, &quot;Open Sans&quot;, Geneva, sans-serif; font-size: 14px; background-color: rgb(246, 246, 246);">Комплектацию представленной двери в части фурнитуры предварительно согласуют с покупателем. Доступные для заказа замочные механизмы, ручки и наблюдательные глазки собраны в соответствующих каталогах на нашем сайте.</p><p style="margin: 8px auto; font-family: Verdana, &quot;Open Sans&quot;, Geneva, sans-serif; font-size: 14px; background-color: rgb(246, 246, 246);">Помимо комплектующих, согласованию подлежит и направление открывания двери. Вне зависимости от опциональных параметров, указанных выше, петли дверных блоков данной модели оснащают противосъёмными фиксаторами, а рабочую створку усиливают двумя рёбрами жёсткости.</p><table style="font-size: 13px; margin-top: 0px; margin-bottom: 40px; background: rgb(255, 255, 255); font-family: Verdana, &quot;Open Sans&quot;, Geneva, sans-serif;"><tbody><tr><td style="padding: 11px 22px 12px; position: relative; border-left: none; border-right: none;"><p style="margin: 8px auto;">Коробка:</p></td><td style="padding: 11px 22px 12p