              'DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><span style="color: rgb(48, 51, 53); font-family: &quot;Open Sans&quot;, sans-serif; word-spacing: 0px;">Специализированные противопожарные стальные двери с огнестойкостью&nbsp;</span><b style="color: rgb(48, 51, 53); font-family: &quot;Open Sans&quot;, sans-serif; word-spacing: 0px;">EI30 (BY)</b><span style="color: rgb(48, 51, 53); font-family: &quot;Open Sans&quot;, sans-serif; word-spacing: 0px;">&nbsp;и&nbsp;</span><b style="color: rgb(48, 51, 53); font-family: &quot;Open Sans&quot;, sans-serif; word-spacing: 0px;">EI30, EI60 (RU)</b><span style="color: rgb(48, 51, 53); font-family: &quot;Open Sans&quot;, sans-serif; word-spacing: 0px;">, для использования в качестве противопожарных преград в различных зданиях и сооружениях. Данные модели не теряют характеристик огнестойкости в течение&nbsp;</span><b style="color: rgb(48, 51, 53); font-family: &quot;Open Sans&quot;, sans-serif; word-spacing: 0px;">30/60 минут.</b></p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Дверное полотно</b>&nbsp;- выполнено из стального листа 1,0 мм. Опция - оцинкованный лист.;</p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Дополнительно</b>&nbsp;- одно-камерный противопожарный стеклопакет в частично-остекленных.&nbsp;<br></p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Дверная&nbsp;коробка</b>&nbsp;- холоднокатаная сталь;<br></p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Отделка полотна и коробки</b>&nbsp;- полимерное покрытие в цвете RAL. Опционально декоративное покрытие Lampre;<br></p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Заполнение полотна</b>&nbsp;- минеральная плита высокой плотности (62 мм) /гипсоволоконная и минеральная плиты высокой плотности (68 мм);</p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Толщина полотна</b>&nbsp;- EI30 - 62 мм. ,EI60 - 68 мм.</p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Количество петель</b>&nbsp;- 3 шт.</p><br>',
