ot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">• хорошая постформируемость</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">• различные структуры поверхности (имитация натуральной древесины)</span><br></p><br>',
