              'DESCRIPTION' => '<div class="field field-name-body field-type-text-with-summary field-label-hidden" style="color: rgb(63, 63, 63); font-family: &quot;Roboto Slab&quot;, &quot;Trebuchet MS&quot;, sans-serif; font-size: 16px;"><div class="field-items"><div class="field-item even" property="content:encoded"><p style="margin-bottom: 0px; padding: 0px;"><br></p><div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even" property="content:encoded"><p style="margin-bottom: 0px; padding: 0px;">Противопожарная дверь с пределом огнестойкости 60 минут (маркировка ДПМ EI-60). Дверь изготовлена по ГОСТ Р 57327-2016 из холоднокатанной стали высшего сорта марки 08ПС производства НЛМК. Цельногнутый короб с наличником - угловая конструкция или торцевой вариант — без наличников, полотно цельнометаллическое на навесах каплевидных с шарикоподшипниками (3 шт.). По периметру полотна наклеены 2 вида уплотнителей: от холодного и горячего дыма — терморасширяющаяся лента 1*15 мм и D-образный трубчатый уплотнитель 12*10 мм. Противопожарная дверь снабжена противопожарным замком и штангой-антипаника, поэтому данная дверь может использоваться как эвакуационная противопожарная дверь. Сферы применения данной двери: крупные торговые центры, гостиничные комплексы. Гарантия на дверь предоставляется 12 месяцев, при условии правильной эксплуатации срок службы двери не менее 10 лет.</p></div></div></div><div id="" class="field-group-table group_harki group-harki field-group-table"><table class="field-group-format group_harki" style="width: 750px; color: rgb(0, 0, 0); margin: 25px 0px 40px;"><caption style="font-weight: 600; color: rgb(80, 80, 80); padding-bottom: 5px;">Характеристики изделия</caption><tbody style="border-top: 1px solid transparent; border-bottom: 2px solid rgb(112, 112, 112);"><tr class=""><th class="field-label" style="border-bottom: 1px solid rgb(112, 112, 112); font-size: 13px; color: rgb(37, 