              'ALIAS' => 'protivopozharnaya-dver-dpm-ei-30-s-avtomaticheskim-porogom',
              'TITLE' => 'Противопожарные двери ДПМ EI-30 с автоматическим порогом',
              'CODE' => 'ДПМ EI-30',
              'SHORT_DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; vertical-align: baseline;"><font color="#333333"><span style="font-size: 14px;">Противопожарная дверь ДПМ EI-30 с автоматическим порогом</span></font><br><br>',
              'DESCRIPTION' => '<div class="field field-name-body field-type-text-with-summary field-label-hidden" style="color: rgb(63, 63, 63); font-family: &quot;Roboto Slab&quot;, &quot;Trebuchet MS&quot;, sans-serif; font-size: 16px;"><div class="field-items"><div class="field-item even" property="content:encoded"><p style="margin-bottom: 0px; padding: 0px;">Противопожарная дверь с пределом огнестойкости 60 минут. Дверь изготовлена по ГОСТ Р 57327-2016 из холоднокатанной стали высшего сорта марки 08ПС производства НЛМК. Цельногнутый короб с наличником - угловая конструкция или торцевой варинат — без наличников, полотно цельнометаллическое на навесах каплевидных с шарикоподшипниками (3 шт.). По периметру полотна наклеены 2 вида уплотнителей: от холодного и горячего дыма — терморасширяющаяся лента 1*15 мм и D-образный трубчатый уплотнитель 12*10 мм. Противопожарная дверь снабжена противопожарным замком и штангой-антипаника, поэтому данная дверь может использоваться как эвакуационная противопожарная дверь. Сферы применения данной двери: крупные торговые центры, гостиничные компклесы.&nbsp;</p></div></div></div><div id="" class="field-group-table group_harki group-harki field-group-table" style="color: rgb(63, 63, 63); font-family: &quot;Roboto Slab&quot;, &quot;Trebuchet MS&quot;, sans-serif; font-size: 16px;"><table class="field-group-format group_harki" style="width: 750px; color: rgb(0, 0, 0); margin: 25px 0px 40px;"><caption style="font-weight: 600; color: rgb(80, 80, 80); padding-bottom: 5px;">Характеристики изделия</caption><tbody style="border-top: 1px solid transparent; border-bottom: 2px solid rgb(112, 112, 112);"><tr class=""><th class="field-label" style="border-bottom: 1px solid rgb(112, 112, 112); font-size: 13px; color: rgb(37, 37, 37); text-transform: uppercase; vertical-align: top; font-family: Raleway, &quot;Helvetica Neue&quot;, Arial, sans-serif; padding-left: 10px !important; font-weight: normal !important; border-top: 1px solid rgb(107, 107, 1