            array (
              'LINK' => 'https://dverprom.by/katalog/dveri-po-funktsionalu/protivopozharnyye-dveri/protivopozharnyye-peregorodki-eiw-45.html',
              'ALIAS' => 'protivopozharnyye-peregorodki-eiw-45',
              'TITLE' => 'Противопожарные перегородки EIW 45',
              'CODE' => 'Противопожарные перегородки EIW 45',
              'SHORT_DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">Алюминиевые противопожарные перегородки — надежные системы, предотвращающие распространение пламени в течение определенного времени.</span><br>',
              'DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;"> Между собой модели отличаются по степени огнестойкости: E/EIS/EIW-15, E/EIS/EIW-30, E/EIS/EIW-45, E/EIS/EIW-60. Данная маркировка указывает время, в течение которого противопожарная перегородка противостоит воздействию огня, не получая значительных повреждений.</span><br style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">Продукция отвечают нормам противопожарной безопасности, предписанными №123-Ф3 «Технический регламент о требованиях пожарной безопасности», СНиП 21-01-97 и ГОСТу Р 53308-2009.</span></p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><img src="https://dec-art66.ru/images/icon_sun.png" width="55" align="left" style="border-style: none; display: block; max-width: 100%; height: auto; margin-bottom: 10px; margin-right: 20px;"></p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><span style="font-weight: bolder;">СТОЙКОСТЬ К УФ ЛУЧАМ</span><br>Показатель стойкости к ультрафиолетовым лучам при производстве противопожарных перегородок определяется прозрачностью стекла. Благодаря используемым стабилизаторам при длительной эксплуатации стекло не начинает темнеть или мутнеть, что определяет высокое качество материала.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><img src="https://dec-art66.ru/images/icon_distortion.png" width="55" align="left" style="border-style: none; display: block; max-width: 100%; height: auto; margin-bottom: 10px; margin-right: 20px;"></p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><span style="font-weight: bolder;">ОТСУТСТВИЕ ОПТИЧЕСКОГО ИСКАЖЕНИЯ</span><br>Вкрапления, оптическое искажение, а также пузырьки относятся к серьезным дефектам. При осуществлении производства противопожарных перегородок технология была отлажена, что позволило избежать появления существенных факторов, мешающих прозрачности отображения.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><img src="https://dec-art66.ru/images/icon_temperature.png" width="55" align="left" style="border-style: none; display: block; max-width: 100%; height: auto; margin-bottom: 10px; margin-right: 20px;"></p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><span style="font-weight: bolder;">ШИРОКИЙ ТЕМПЕРАТУРНЫЙ ДИАПАЗОН</span><br>Наиболее широким диапазоном при учете температуры для эксплуатации противопожарных перегородок можно считать границы от -30 до +50. Наши перегородки изготавливаются согласно предъявленным стандартам, поэтому стекло остается прозрачным даже при очень низких температурах.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><img src="https://dec-art66.ru/images/icon_fiting.png" width="55" align="left" style="border-style: none; display: block; max-width: 100%; height: auto; margin-bottom: 10px; margin-right: 20px;"></p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><span style="font-weight: bolder;">ПРОТИВОПОЖАРНАЯ ФУРНИТУРА</span><br>Наши противопожарные перегородки отличаются не только высоким качеством, но и наличием противопожарной фурнитуры. Именно это позволяет в несколько раз увеличить безопасность при дальнейшей эксплуатации перегородок. Более того, фурнитура не токсична.</p><br>',
