арный замок Apecs 1900-ZN с ответной планкой и фрезеровка под петли Hafele 102х76 мм (нержавеющая сталь) 3 шт.&nbsp;</span><span style="margin: 0px; padding: 0px; font-weight: 700; color: rgb(56, 56, 56); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">Замок, ответная планка и петли ВХОДЯТ в комплект поставки.</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="margin: 0px; padding: 0px; font-weight: 700; color: rgb(56, 56, 56); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">Предел огнестойкости</span><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">&nbsp;EI30 по ГОСТ Р 53307-2009</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="margin: 0px; padding: 0px; font-weight: 700; color: rgb(56, 56, 56); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">Вес дверного полотна</span><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">&nbsp;~ 60 кг</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="margin: 0px; padding: 0px; font-weight: 700; color: rgb(56, 56, 56); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">Толщина полотна</span><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">&nbsp;- 42 мм</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-ser