(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><b>Покрытие</b> - экошпон 4 цветов: 3D Дуб венге, Дуб золотой, Дуб беленый, Капучино.</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><b>Cтекло </b>22 мм, 25% площади по центру. Остекление противопожарных полотен производится в заводских условиях с использованием специального огнестойкого стекла марки «Бранд Гласс ПАРАФЛАМ-EIW 30» и штапика из массива дуба.</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">На полотне в заводских условиях установлены:</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><u>Полотно </u>- Замок под евроциллиндр Abloy 4292 хром</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">- Шпингалеты хром 2 шт. в ответном полотне;</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font