лщиной 3мм.</span><br style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">• Уплотнитель: По периметру двери резиновый уплотнительный профиль.</span></p><h2 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px; text-align: justify;">Описание маятниковых дверей МД для офисных помещений</h2><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">Двери маятникового типа являются эффективной альтернативой обычным распашным дверям и предназначены для установки в местах прохода людей и провоза багажа определенной высоты (определяется уровнем высоты защитного бампера). Полотно и комплектующие двери изготавливаются из качественных материалов, что обеспечивает длительный срок службы и надежность всей конструкции. МД&nbsp;для офисов полностью соответствуют всем нормативным и санитарным требованиям, предъявляемым к дверям данного типа.</p><h2 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px; text-align: justify;">Конструкция и виды рам</h2><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">Толщина материала рам 1,5 мм. Покрытие – на выбор краска порошковая RAL9003 (если полотно RAL9003) или RAL7035 (если полотно RAL7035). Материал (опция)- нержавеющая сталь AISI430, нержавеющая сталь AISI304.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">а)<span style="font-weight: bolder;">"Рама внутрь проема"&nbsp;</span>монтируется внутрь проема с использованием сквозного скрытого крепежа.<br>Рекомендуемая установка на несущие стены из бетона или цельного кирпича.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">б)&nbsp;<span style="font-weight: bolder;">"Рама в обхват проема"</span>&nbsp;монтируется с двух сторон проема с использованием сквозного скрытого крепежа.<br>Рекомендуемая установка на стены из сэндвич панелей, гипсокартонные перегородки и любые другие ненесущие конструкции в качестве усиления и/или защиты проема от ударов.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">в)&nbsp;<span style="font-weight: bolder;">"Угловая рама"</span>&nbsp;монтируется с одной стороны проема с использованием скрытого крепежа<br>Рекомендуемая установка на несущие стены из бетона или цельного кирпича в качестве усиления углов проема.</p><h2 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px; text-align: justify;">Характеристики петель</h2><ul style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><li>Все элементы петли, выполнены из пищевой нержавеющей стали AISI430</li><li>Уверенная фиксация полотна в створе проема</li><li>Мягкий ход открывания/закрывания двери (не бьет в спину)</li><li>Постоянная средняя скорость закрытия (не зависит от угла открытия)</li></ul><section class="content" style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><h2 style="margin-bottom: 0.5rem; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px;">Эксклюзивные цвета</h2><p style="margin-bottom: 1rem;"><img src="data:image/png;base64," style="border-style: none; display: block; max-width: 100%; height: auto;"></p></section><section clas