14px;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px;">• Уплотнитель: По периметру двери резиновый уплотнительный профиль.</span></p><h2 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px; text-align: justify;">Описание маятниковых дверей&nbsp;с фиксацией</h2><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">Двери маятникового типа с фиксацией положения являются актуальной заменой распашным дверям в помещениях со средней интенсивностью проходящего потока людей и грузов. Особыми условиями эксплуатации дверей данного типа являются активная ветровая нагрузка, содержание соли, пыли или образива в воздушных массах. Полотно двери, рама и комплектующие изготовлены из качественных материалов, обеспечивающих долговечность, удобство и эффективность использования.&nbsp;Маятниковые двери с фиксацией производятся в полном соответствии со всеми нормативными и санитарными требованиям, предъявляемыми к дверям данного типа.</p><h2 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px; text-align: justify;">Конструкция и виды рам</h2><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">Толщина материала рам 1,5 мм. Покрытие – на выбор краска порошковая RAL9003 (если полотно RAL9003) или RAL7035 (если полотно RAL7035). Материал (опция)- нержавеющая сталь AISI430, нержавеющая сталь AISI304.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">а)<span style="font-weight: bolder;">"Рама внутрь проема"&nbsp;</span>монтируется внутрь проема с использованием сквозного скрытого крепежа.<br>Рекомендуемая установка на несущие стены из бетона или цельного кирпича.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">б)&nbsp;<span style="font-weight: bolder;">"Рама в обхват проема"</span>&nbsp;монтируется с двух сторон проема с использованием сквозного скрытого крепежа.<br>Рекомендуемая установка на стены из сэндвич панелей, гипсокартонные перегородки и любые другие ненесущие конструкции в качестве усиления и/или защиты проема от ударов.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">в)&nbsp;<span style="font-weight: bolder;">"Угловая рама"</span>&nbsp;монтируется с одной стороны проема с использованием скрытого крепежа<br>Рекомендуемая установка на несущие стены из бетона или цельного кирпича в качестве усиления углов проема.</p><h2 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px; text-align: justify;">Характеристики петель</h2><ul style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><li>Все элементы петли, выполнены из прочного композита</li><li>Уверенная фиксация полотна в створе проема</li><li>Жесткий ход открывания/закрывания двери под действием пружинного механизма</li><li>Фиксация полотна двери в открытом положении под углом 90°</li><li>Прогрессивная скорость закрытия (чем больше угол открытия, тем сильнее и быстрее закрытие)</li></ul><section class="content" style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><h2 style="margin-bottom: 0.5rem; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px;">Эксклюзивные цвета</h2><p style="margin-bottom: 1rem;"><img src="data:image/png;base64," style="border-style: none; display: block; max-width: 100%; height: auto;"></p></section><section class="content" style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><h2 style="margin-bottom: 0.5rem; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px;">Опции</h2><ol style="margin-bottom: 1rem;"><li><span class="clickable">Окно</span></li><li><span class="clickable">Запорные механизмы</span></li><li><span class="clickable">Бампер под руки с одной стороны одной створки</span></li><li><span class="clickable">Бампер в нижней части полотна с одной стороны одной створки</span></li><li><span class="clickable">Стоимость нержавеющей обшивки за одну сторону одного полотна</span></li><li><span class="clickable">Эксклюзивные цвета (сроки производства увеличиваются)</span></li><li><span class="clickable">Материал (цвет) рамы двери (сроки изготовления увеличиваются)</span></li></ol></section><br>',
