              'TITLE' => 'Двери маятниковые пластиковые МДП1',
              'CODE' => 'Дверь маятниковая пластиковая МДП1',
              'SHORT_DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; text-align: justify; word-spacing: 0px; background-color: rgb(248, 248, 248);">Маятниковые двери из пластика устанавливаются в помещениях с постоянным потоком людей и грузов с отсутствием регулировки или ограничения движения.</span><br>',
              'DESCRIPTION' => '<p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">В условиях интенсивных ударных нагрузок двери данного типа зарекомендовали себя как надежные и долговечные, в частности - при активном использовании их в помещениях с повышенным содержанием соли, крупной пыли или абразива.</p><div class="product-short-description" style="margin: 0px 0px 16px; padding: 0px; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px;">Назначение<br>в условиях сверх высоких ударных нагрузок на дверное полотно<br>в условиях очень высоких требований к механическому износу полотна<br>в помещениях с повышенными требованиями к гигиене<br>в технических помещениях с сверх интенсивным трафиком людей, ручных тележек, моторизованных средств (погрузчиков)<br>в условиях повышенного содержания соли в воздухе<br>в условиях постоянной 80% влажности и температуры от -30…+55°С, и непродолжительной влажности 100%<br>в помещениях с использованием монорельса<br>в присутствии крупной пыли и абразива в воздухе</div><div class="product-fields" style="margin: 0px; display: inline-block; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px;"><div class="product-field product-field-type-E" style="width: 320px; float: left; display: inline-block; margin-bottom: 6px;"><span class="product-fields-title-wrapper" style="min-width: 160px; font-weight: bold; padding: 0px; float: left;"><span class="product-fields-title"><span style="font-weight: bolder;">Тип двери -&nbsp;</span></span>Одностворчатая</span><div class="product-field-display" style="vertical-align: middle;"><div class="cf4all_customvalues_wrapper"><br></div></div></div><div class="product-field product-field-type-E" style="width: 320px; float: left; display: inline-block; margin-bottom: 6px;"><span class="product-fields-title-wrapper" style="min-width: 160px; font-weight: bold; padding: 0px; float: left;"><span class="product-fields-title"><span style="font-weight: bolder;">Тип открывания</span></span></span><div class="product-field-display" style="vertical-align: middle;"><div class="cf4all_customvalues_wrapper"><span class="cf4all_option" id="cf4all_option_6">Маятниковая</span></div></div></div></div><h2 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px; text-align: justify;">Полотно двери</h2><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">Изготавливается из высокомолекулярного полиэтилена толщиной 15 мм, бело-молочного, зеленого или черного цвета. Материал обладает отличной химической стойкостью, не прихотлив к обработке, легко моется, не является средой для размножения бактерий. Такие характеристики как, низкая плотность, высокая ударная вязкость, стойкость к износу и истиранию, делают такое полотно не только долговечным, но и сохраняет его первозданный внешний вид.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">Для придания дополнительной жесткости, со стороны петель устанавливается декоративное обрамление из пищевой нержавеющей стали. Места крепления петель усиливаются пластиковыми элементами.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">В полотно устанавливается смотровое окно овальной формы с размерами 300х600мм, выполненное из ударопрочного поликарбонатного стекла толщиной 15мм. Уникальная технология, разработанная заводом, позволяет жестко фиксировать стекло в единую плоскость с полотном, без использования дополнительных элементов крепления, создавая впечатление легкой, целостной конструкции.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">По желанию, возможна установка бамперов. Для их производства используется материал аналогичный материалу полотна. Установка осуществляется одновременно с двух сторон в нижней или средней части створки.</p><h2 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px; text-align: justify;">Рама двери</h2><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">Изготавливается из пищевой нержавеющей стали толщиной 1,5 мм. Существует несколько видов конструкции рамы, которая подбирается в зависимости от типа и толщины стены.</p><h5 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(68, 68, 68); font-size: 1.25rem; text-align: justify;">Рама в обхват проема</h5><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">Для установки на ненесущие перегородки. Изготавливается индивидуально под толщину стены, от 50 до 400мм.</p><h5 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(68, 68, 68); font-size: 1.25rem; text-align: justify;">Рама угловая</h5><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">Для установки на несущие стены или жесткие металлические конструкции.&nbsp;</p><h5 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(68, 68, 68); font-size: 1.25rem; text-align: justify;">Рама внутри проема</h5><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">Для установки внутри глубоких проемов или при отсутствии одной из стенок.</p><h2 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px; text-align: justify;">Петли</h2><h5 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(68, 68, 68); font-size: 1.25rem; text-align: justify;">Петля V-cam</h5><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">Для навеса створок используется петля гравитационного принципа действия. При открывании створки приподнимаются, а затем под силой собственной тяжести возвращаются в исходное положение. Петля обладает быстрым, но плавным ходом закрывания. Механизм петли максимально прост и надёжен, имеет внешнюю защиту от попадания пыли и абразива, все его элементы изготавливаются из износостойких материалов.</p><h5 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(68, 68, 68); font-size: 1.25rem; text-align: justify;">Петля Cas 4150</h5><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">В качестве альтернативы возможна установка импортной торсионной петли выполненной из прочного композита. Отличается более жестким ходом закрывания, уверенной фиксацией в исходном положении, также обладает функцией фиксации полотна в открытом положении на 90°. Рекомендуется для установки дверей при наличии сильных сквозняков. Совместно с пластиковым полотном создается гармоничный внешний вид.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">При использовании данной петли на полотно не устанавливается боковой швеллер, а П-образная рама изготавливается минимальной ширины, что расширяет возможности ее использования.</p><br>',
