              'DESCRIPTION' => '<div class="product-short-description" style="margin: 0px 0px 16px; padding: 0px; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px;">Характеристики полотна двери<br>Эластичное, обрамленное с двух сторон специальным алюминиевым профилем<br>Толщина полотна 7 мм<br>Материалы полотен :<br>прозрачная ПВХ пленка (-25 0С…+30 0С);<br>непрозрачная серая ПВХ пленка (-15 0С…+50 0С);<br>морозостойкая резина (-30 0С…+50 0С).<br><br>Максимальные размеры дверей для одностворчатой и двустворчатой двери стандартного ряда: одностворчатая - 1250х3000 MAX, двустворчатая - 2500х3000 MAX.<br></div><div class="product-short-description" style="margin: 0px 0px 16px; padding: 0px; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px;"><h2 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px; text-align: justify;">Описание пленочных маятниковых дверей</h2><p style="margin-bottom: 1rem; text-align: justify;">Пленочные двери маятникового типа являются эффективной альтернативой обычным распашным дверям и предназначены для установки в промышленных или складских помещениях с очень интенсивным трафиком, в которых может быть повышено содержание соли в воздухе, ветровая нагрузка и возможно наличие крупной пыли или абразива в воздухе. Полотно двери и комплектующие изготовлены на основе качественных материалов, обеспечивающих повышенную надежность и длительный срок службы конструкции.&nbsp;Пленочные маятниковые двери соответствуют всем нормативам и санитарным требованиям, предъявляемым к промышленным дверям данного типа.</p><h2 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px; text-align: justify;">Конструкция и виды рам</h2><p style="margin-bottom: 1rem; text-align: justify;">Толщина материала рам 1,5 мм. Покрытие – порошковая RAL9003. Материал (опция)- нержавеющая сталь AISI430, нержавеющая сталь AISI304.</p><p style="margin-bottom: 1rem; text-align: justify;">а)<span style="font-weight: bolder;">"П-образная рама"&nbsp;</span>монтируется внутрь проема с использованием сквозного скрытого крепежа.<br>Рекомендуемая установка на несущие стены из бетона или цельного кирпича.</p><p style="margin-bottom: 1rem; text-align: justify;">б)&nbsp;<span style="font-weight: bolder;">"Рама в обхват проема"</span>&nbsp;монтируется на проем с использованием сквозного скрытого крепежа.<br>Рекомендуемая установка на стены из сэндвич панелей, гипсокартонные перегородки и любые другие ненесущие конструкции в качестве усиления и/или защиты проема от ударов.</p><h2 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px; text-align: justify;">Характеристики петель</h2><ul style="margin-bottom: 1rem; text-align: justify;"><li>Присутствует значительное усилие старта открытия</li><li>Допускаются сквозняки</li><li>Все элементы петли, выполнены из пищевой нержавеющей стали AISI304</li><li>Уверенная фиксация полотна в створе проема</li><li>Мягкий ход открывания/закрывания двери (не бьет в спину)</li><li>Постоянная средняя скорость закрытия (не зависит от угла открытия)</li></ul><section class="content" style="text-align: justify;"><h2 style="margin-bottom: 0.5rem; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px;">Эксклюзивные цвета</h2><p style="margin-bottom: 1rem;"><img src="data:image/png;base64," style="border-style: none; display: block; max-width: 100%; height: auto;"></p></section><section class="content" style="text-align: justify;"><h2 style="margin-bottom: 0.5rem; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px;">Опции</h2><ol style="margin-bottom: 1rem;"><li>Материал (цвет) рамы двери (сроки изготовления увеличиваются)</li><ul><li>Эксклюзивный (требуется предварительное подтверждение) цвет рамы</li><li>Нержавеющая сталь AISI304 (пищевая) S1,5 мм. П-ОБРАЗНАЯ РАМА</li><li>Нержавеющая сталь AISI304 (пищевая) S1,5 мм. РАМА В ОБХВАТ 250мм</li><li>Нержавеющая сталь AISI430 S1,5 мм. П-ОБРАЗНАЯ РАМА</li><li>Нержавеющая сталь AISI430 S1,5 мм. РАМА В ОБХВАТ 250мм</li></ul></ol></section></div><br>',
