              'DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">Полотно двери.&nbsp;</span><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">Стандартное исполнение</span><br style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">• Материал полотна: Лёгкое многослойное полотно, обрамленное по периметру специальным алюминиевым профилем</span><br style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">• Толщина полотна: 40мм</span><br style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">• Цвет полотна: стандартный- RAL9003 белый, Цвет RAL7035 серый</span><br style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">• Окно: овальное с резиновым обрамлением 300х580</span><br style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">• Материал окна: Поликарбонат то