<br>Рекомендуемая установка на несущие стены из бетона или цельного кирпича.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">б)&nbsp;<span style="font-weight: bolder;">"Рама в обхват проема"</span>&nbsp;монтируется с двух сторон проема с использованием сквозного скрытого крепежа.<br>Рекомендуемая установка на стены из сэндвич панелей, гипсокартонные перегородки и любые другие ненесущие конструкции в качестве усиления и/или защиты проема от ударов.</p><p style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;">в)&nbsp;<span style="font-weight: bolder;">"Угловая рама"</span>&nbsp;монтируется с одной стороны проема с использованием скрытого крепежа<br>Рекомендуемая установка на несущие стены из бетона или цельного кирпича в качестве усиления углов проема.</p><h2 style="margin-bottom: 0.5rem; font-family: &quot;Trebuchet MS&quot;, sans-serif; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px; text-align: justify;">Характеристики петель</h2><ul style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><li>Все элементы петли, выполнены из прочного композита</li><li>Уверенная фиксация полотна в створе проема</li><li>Жесткий ход открывания/закрывания двери под действием пружинного механизма</li><li>Фиксация полотна двери в открытом положении под углом 90°</li><li>Прогрессивная скорость закрытия (чем больше угол открытия, тем сильнее и быстрее закрытие)</li></ul><section class="content" style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify;"><h2 style="margin-bottom: 0.5rem; line-height: 1.2; color: rgb(255, 136, 0); font-size: 18px;">Эксклюзивные цвета</h2><p style="margin-bottom: 1rem;"><img src="data:image/png;base64," style="border-st