; font-size: 14px;"><b>Отделка&nbsp;коробки</b>&nbsp;- полимерное покрытие в цвете RAL;</p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Заполнение полотна</b>&nbsp;- ДСП, МДФ;</p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Толщина полотна</b>&nbsp;- 50 мм;</p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Фурнитура</b>&nbsp;- магнитный замок, скрытые петли;</p><p style="margin-bottom: 10px; color: rgb(48, 51, 53); font-size: 14px;"><b>Звукоизоляция</b>&nbsp;- 25 dB (класс А).</p><br>',
