              'TITLE' => 'Высокие двери TALL OVER',
              'CODE' => 'TALL OVER  высокие двери',
              'SHORT_DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; vertical-align: baseline;"><font color="#383838" face="Open Sans, Arial, sans-serif"><span style="font-size: 15px;"><b>TALL OVER&nbsp; высокие двери</b></span></font><br><br>',
              'DESCRIPTION' => '<p style="color: rgb(52, 52, 52); font-family: &quot;Proxima Nova Rg&quot;, sans-serif; font-size: 14px;"><br></p><p style="color: rgb(52, 52, 52); font-family: &quot;Proxima Nova Rg&quot;, sans-serif; font-size: 14px;">Мы все привыкли к тому, что высота дверей по умолчанию соответствует 2000 мм. Но это — не единственная высота, которая может быть у межкомнатной двери (в том числе — и стандартного размера) В последнее время среди стандартных высот производителями предлагаются &nbsp;также и размеры 2100, 2200 и 2300 мм. И поверьте, — эта разница весьма заметно влияет на общее восприятие интерьера! &nbsp;Более того, чем выше дверь, тем она и смотрится эффектнее, и больше света и воздуха пропускает в комнату. Это &nbsp;не единственный вариант по стилю, в классическом стиле такие варианты тоже присутствуют. Единственное, что при выборе в пользу классики — сверху необходимо оставлять место для установки обрамления и карнизов.</p><p style="color: rgb(52, 52, 52); font-family: &quot;Proxima Nova Rg&quot;, sans-serif; font-size: 14px;">Размер высоты двери обязательно должен быть известен заранее — до того момента, как ваши строители поставят перемычки для дверей в вашей любимой квартире! Помимо этого, считаем своим долгом напомнить о том, что межкомнатные двери в помещении (если их несколько) хорошо смотрятся одной высоты (единой)</p><br>',
