              'SHORT_DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">Гладкая дверь окрашенная в белый цвет по NCS S 0502-Y выполнена по технологии сэндвич конструкции и является полным аналогом финских дверей, завоевавших популярность на российском рынке в середине 1990-х начале 2000-х.</span><br>',
              'DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><br></span><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">Двери этой серии имеют абсолютное сходство с производимыми дверьми в Финляндии по своим габаритам, комплектации. Особенностью сэндвич конструкции для данного типа двери является ее малый вес по сравнению с другими конструкциями усиленных дверей,&nbsp;при этом характеристики прочности двери ничем не уступают дверям с полнотелым &nbsp;заполнением. Данные характеристики достигаются благодаря каркасу из бруска, заполнению пространства каркаса Трубчатым ДСП &nbsp;SAUERLAND&nbsp;, и два листа 3 мм HDF (high-desteny-fibreboard - ДВП- Высокой плотности).</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">Двери полностью готовы к монтажу - все необходимые фрезеровки выполнены в заводских условиях - вам лишь необходимо собрать дверь с коробкой как конструктор.</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">Отличительной особенностью дверей серии 100 ("финская дверь")&nbsp; является невысокая стоимость при высоких эксплуатационных характеристиках: наличии&nbsp; четверти (притвора), окрашенной поверхности, заводские фрезеровки под фурнитуру, коробка из массива дерева с установленной фурнитурой - гарантируют быстрый и простой монтаж, замену полотен без необходимости менять коробку (стандарты финской двери не меняются уже более 40 лет), а при мелких дефектах, легко отреставрировать окрашенную поверхность.</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">При использовании коробки и порога&nbsp;с уплотнителем достигается уровень звукоизоляции в 28 db.</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">Толщина дверного полотна 40 мм.&nbsp;</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="margin: 0px; padding: 0px; font-weight: 700; color: rgb(56, 56, 56); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">Комплектация:</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"></p><ul style="margin-right: 0px; margin-bottom: 27px; margin-left: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px;"><li style="margin: 0px 0px 4px; padding: 0px 0px 0px 20px; list-style-type: none; position: relative;">&nbsp;M7-M10 Фрезеровка под корпус межкомнатного замка 2014&nbsp; (возможна установка замка 2018 - под цилиндр)</li><li style="margin: 0px 0px 4px; padding: 0px 0px 0px 20px; list-style-type: none; position: relative;">Фрезеровка под ручку и цилиндр.</li><li style="margin: 0px 0px 4px; padding: 0px 0px 0px 20px; list-style-type: none; position: relative;">Ответная часть петли FT-65 на полотне (2 шт)</li></ul><p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="margin: 0px; padding: 0px; font-weight: 700; color: rgb(56, 56, 56); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">Размеры односпальных (одностворчатых) дверей:</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">М7*21 - полотно 625*2040 мм. По коробке 690*2090 мм.</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: