; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">Высокая устойчивость к средствам бытовой химии, эта дверь предназначена для использования в помещениях, где часто проводится влажная уборка с применением средств бытовой химии и дезинфекции.</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"></p><p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;">Цвет: Венге, Дуб беленый, Дуб золотой, Орех итальянский, Орех миланский, Титан</p><p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"><span style="color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;">Конструкция:</span><br style="margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px; word-spacing: 0px;"></p><ul style="margin-right: 0px; margin-bottom: 27px; margin-left: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 15px;"><li styl