;"><li>Относительно легкий вес, что делает противопожарные двери с остеклением конструкцией, которую разрешено устанавливать в постройки любой этажности;</li><li>Стойкость к образованию, распространению ржавчины. Конструкции исправно функционируют даже в помещениях с повышенными показателями влажности;</li><li>Практичность. Мыть и чистить двери из алюминиевого профиля можно универсальными моющими средствами.</li></ul><br>',
