            array (
              'LINK' => 'https://dverprom.by/katalog/dveri-po-funktsionalu/plastikovyye-dveri-pvh/plastikovyye-balkonnyye-dveri.html',
              'ALIAS' => 'plastikovyye-balkonnyye-dveri',
              'TITLE' => 'Пластиковые балконные двери',
              'CODE' => 'балконные двери',
              'SHORT_DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; vertical-align: baseline;"><span style="color: rgb(139, 113, 72); font-family: &quot;Fira Sans&quot;, Arial, sans-serif; font-size: 16px;">Балконные двери ПВХ из поливинилхлорида.</span><br>',
              'DESCRIPTION' => '<p class="windows__subs-content" style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(86, 76, 59);">При утеплении квартиры или комнаты в жилом доме особое внимание стоит уделить установке надежных и эффективных оконных систем. Как правило, дополнительное застекление балкона не обеспечивает должного уровня комфорта и звукоизоляции помещения. Решение проблемы — выбрать подходящие пластиковые двери ПВХ в Минке и грамотно смонтировать конструкцию дверной коробки. Легкий профиль существенно снижает вес конструкции, облегчая установку, регулировку петель и фурнитуры. Компания «ДверьПром» предлагает широкий ассортимент дверей из пластика разных конфигураций:&nbsp;<span style="font-family: inherit; font-size: inherit; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;">Одностворчатые балконные двери. Обладают повышенной теплоизоляцией, сохраняют тепло внутри комнаты. Слой утеплителя препятствует проникновению холодного воздуха с улицы.&nbsp;</span><span style="font-family: inherit; font-size: inherit; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;">Двустворчатые конструкции, идеально подходящие для просторных помещений. За счет большей площади остекления комната становится светлее и уютнее.</span></p><ul class="windows__subs-list" style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-left: 20px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; list-style: none; color: rgb(86, 76, 59); padding-bottom: 20px !important;"><li class="windows__subs-item" style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; position: relative;"><p class="windows__subs-content" style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; vertical-align: baseline; color: rgb(139, 113, 72);"><br></p><p class="windows__subs-content" style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; vertical-align: baseline; color: rgb(139, 113, 72);">Балконные двери ПВХ производятся из поливинилхлорида и обладают следующими достоинствами:</p><p class="windows__subs-content" style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; vertical-align: baseline; color: rgb(139, 113, 72);"><span style="font-family: inherit; font-size: inherit; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;">- Универсальность. Пластиковые двери устанавливаются повсеместно: в жилых домах, на балконах, в общественных местах, офисных и производственных помещениях.</span></p><p class="windows__subs-content" style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; vertical-align: baseline; color: rgb(139, 113, 72);"><span style="font-family: inherit; font-size: inherit; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;">-&nbsp;</span><span style="font-family: inherit; font-size: inherit; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;">Широкое разнообразие форм и вариантов конструкции. Химические свойства сырья позволяют проектировать конструкции любого размера и площади остекления.</span></p><p class="windows__subs-content" style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; vertical-align: baseline; color: rgb(139, 113, 72);"><span style="font-family: inherit; font-size: inherit; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;">- Цена на балконные двери из пластика ниже, чем у изделий из натуральных природных материалов. При этом уровень теплоизоляции находится на высоком уровне, таком же, каким обладают алюминиевые изделия.</span></p><p class="windows__subs-content" style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; vertical-align: baseline; color: rgb(139, 113, 72);"><span style="font-family: inherit; font-size: inherit; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;">-&nbsp;</span><span style="font-family: inherit; font-size: inherit; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;">Долговечны и устойчивы к воздействию ультрафиолетовых лучей, дождя и снега.&nbsp;</span></p><p class="windows__subs-content" style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; vertical-align: baseline; color: rgb(139, 113, 72);"><span style="font-family: inherit; font-size: inherit; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;">-&nbsp;</span><span style="font-family: inherit; font-size: inherit; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;">Все изделия комплектуются современной фурнитурой и замочными системами, которые обеспечат надежную защиту людей и их имущества.</span></p><p class="windows__subs-content" style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; vertical-align: baseline; color: rgb(139, 113, 72);"><span style="font-family: inherit; font-size: inherit; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;">-&nbsp;&nbsp;</span><span style="font-family: inherit; font-size: inherit; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-weight: inherit;">Герметичность, простота в обслуживании и ремонте.</span></p></li></ul><br>',
