            10 => 
            array (
              'LINK' => 'https://dverprom.by/katalog/dveri-po-funktsionalu/plastikovyye-dveri-pvh/plastikovyye-ofisnyye-dveri.html',
              'ALIAS' => 'plastikovyye-ofisnyye-dveri',
              'TITLE' => 'Пластиковые двери',
              'CODE' => 'Пластиковые офисные двери',
              'SHORT_DESCRIPTION' => '<h4 style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(139, 113, 72);"><span style="color: rgb(86, 76, 59); font-family: &quot;Fira Sans&quot;, Arial, sans-serif; font-size: 14px;">При оформлении офиса или другого административного объекта особое внимание уделяется дверям. Они должны быть надежными и безопасными, прекрасно справляться с интенсивной эксплуатацией, иметь высокий показатель шумоизоляции, быть просты в уходе и гармонировать с интерьером помещения.<br></span>Все эти качества сочетают в себе пластиковые двери. Строгие и лаконичные, они прекрасно впишутся в интерьер любого офиса или бизнес-центра. Двери ПВХ способны долгое время сохранять свой первоначальный вид в условиях постоянного открывания-закрывания. Они надежно защищают кабинет от посторонних шумов, а также являются безопасными для здоровья сотрудников.<br>Чаще всего в офисах устанавливают классические распашные двери. Они легки в эксплуатации, оптимальны в соотношении цены и качества. Для офисных помещений с небольшой площадью отлично подходят пластиковые раздвижные двери, которые помогают экономить пространство.<br>В офисных помещениях на протяжении большей части дня кипит работа и решаются важные вопросы, которые зачастую требуют конфиденциальности. Кроме этого рабочий процесс сопряжен с перемещением сотрудников между кабинетами, а также посещением офиса другими людьми. Из-за этих особенностей к пластиковым офисным дверям предъявляются особые требования.<ul><li style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; position: relative;">Надежность. Двери должны выдерживать сотни тысяч циклов открывания-закрывания и сохранять свои качества в условиях высокой проходимости.</li></ul><ul><li style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; position: relative;">Высокая звуконепроницаемость. Дверь должна надежно защищать от посторонних шумов, а также не допускать, чтобы переговоры, происходящие в кабинете, были услышаны снаружи.</li></ul><ul><li style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; position: relative;">Экологичность. В офисах сотрудники проводят большую часть дня, поэтому двери не должны выделять химических испарений, которые могут нанести вред здоровью при длительном пребывании в помещении.</li></ul><ul><li style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; position: relative;">Простота в уходе. Офисные двери должны легко и быстро очищаться от загрязнений, что важно в условиях интенсивной эксплуатации.</li></ul><ul><li style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; position: relative;">Лаконичный внешний вид. Дверь должна сочетаться с остальным интерьером офиса и не отвлекать от рабочего процесса ярким цветом или излишним декором.</li></ul></h4><br>',
              'DESCRIPTION' => '<h4 style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(139, 113, 72);"><span style="color: rgb(86, 76, 59); font-family: &quot;Fira Sans&quot;, Arial, sans-serif; font-size: 14px;">При оформлении офиса или другого административного объекта особое внимание уделяется дверям. Они должны быть надежными и безопасными, прекрасно справляться с интенсивной эксплуатацией, иметь высокий показатель шумоизоляции, быть просты в уходе и гармонировать с интерьером помещения.<br></span>Все эти качества сочетают в себе пластиковые двери. Строгие и лаконичные, они прекрасно впишутся в интерьер любого офиса или бизнес-центра. Двери ПВХ способны долгое время сохранять свой первоначальный вид в условиях постоянного открывания-закрывания. Они надежно защищают кабинет от посторонних шумов, а также являются безопасными для здоровья сотрудников.<br>Чаще всего в офисах устанавливают классические распашные двери. Они легки в эксплуатации, оптимальны в соотношении цены и качества. Для офисных помещений с небольшой площадью отлично подходят пластиковые раздвижные двери, которые помогают экономить пространство.<br>В офисных помещениях на протяжении большей части дня кипит работа и решаются важные вопросы, которые зачастую требуют конфиденциальности. Кроме этого рабочий процесс сопряжен с перемещением сотрудников между кабинетами, а также посещением офиса другими людьми. Из-за этих особенностей к пластиковым офисным дверям предъявляются особые требования.<ul><li style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; position: relative;">Надежность. Двери должны выдерживать сотни тысяч циклов открывания-закрывания и сохранять свои качества в условиях высокой проходимости.</li></ul><ul><li style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; position: relative;">Высокая звуконепроницаемость. Дверь должна надежно защищать от посторонних шумов, а также не допускать, чтобы переговоры, происходящие в кабинете, были услышаны снаружи.</li></ul><ul><li style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; position: relative;">Экологичность. В офисах сотрудники проводят большую часть дня, поэтому двери не должны выделять химических испарений, которые могут нанести вред здоровью при длительном пребывании в помещении.</li></ul><ul><li style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; position: relative;">Простота в уходе. Офисные двери должны легко и быстро очищаться от загрязнений, что важно в условиях интенсивной эксплуатации.</li></ul><ul><li style="margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; position: relative;">Лаконичный внешний вид. Дверь должна сочетаться с остальным интерьером офиса и не отвлекать от рабочего процесса ярким цветом или излишним декором.</li></ul></h4><br>',
