              'TITLE' => 'Раздвижные противопожарные двери',
              'CODE' => 'Раздвижные противопожарные двери',
              'SHORT_DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">Противопожарные алюминиевые конструкции производятся на основе гибкого, легкого, пластичного металлического профиля. Из него можно создавать двери любой конфигурации и габаритов.</span><br>',
              'DESCRIPTION' => '<p class="shop_property" style="margin-bottom: 0px; word-spacing: 3px; color: rgb(62, 71, 75); font-size: 14px; padding: 5px 0px; border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(172, 172, 172); font-stretch: inherit; line-height: 21px; font-family: Arial, sans-serif; vertical-align: baseline;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">Алюминий устойчив к воздействию влаги. Не теряет своей работоспособности в условиях повышенных температур. Он не выделяет токсичных веществ и ядовитых газов при прямом контакте с огнем.</span><br style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">Дополнительно алюминиевые противопожарные двери с остеклением оснащаются стеклопакетом, который не разрушается при высоком температурном режиме. Он герметичен. Имеет стильный дизайн, современный внешний вид.</span><br style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">Комплектуются конструкции термоизолятором, лентой для защиты помещений от дыма и огнестойкой запорной фурнитурой. При возгорании лента расширяется, заполняя щели. Фурнитура действует даже при нагревании. Последствия аварии тем самым не распространяются за пределы объекта.</span><br style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;"><span style="color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; word-spacing: 0px;">Каждый из используемых элементов соответствует ГОСТ.</span></p><ul style="margin-bottom: 1rem; color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, sans-serif; font-size: 14px; text-align: justify