              'LINK' => 'https://dverprom.by/katalog/dveri-po-funktsionalu/plastikovyye-dveri-pvh/plastikovyye-mezhkomnatnyye-dveri.html',
              'ALIAS' => 'plastikovyye-mezhkomnatnyye-dveri',
              'TITLE' => 'Пластиковые межкомнатные двери',
              'CODE' => 'межкомнатные двери',
              'SHORT_DESCRIPTION' => '<h4 style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(139, 113, 72);"><span style="color: rgb(86, 76, 59); font-family: &quot;Fira Sans&quot;, Arial, sans-serif; font-size: 14px;">Пластиковые межкомнатные двери – популярный вид дверных конструкций, который подходит для установки в самых разнообразных помещениях.</span></h4><h4 style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(139, 113, 72);">При изготовлении таких дверей используются те же профили, что и при изготовлении окон. Сочетание качественного профиля и пластика обуславливает многие преимущества межкомнатных дверей ПВХ. Такие двери долговечны и просты в эксплуатации. Благодаря высокой влагостойкости, они не рассохнуться, как это часто случается с деревянными дверьми. А использование алюминиевого профиля в основе дверной конструкции позволяет им не деформироваться в процессе эксплуатации и при механических повреждениях. Из-за однотипности долгое время пластиковые межкомнатные двери устанавливались в основном в офисных зданиях и общественных учреждениях. Однако современные технологии позволяют создавать по-настоящему красивые изделия с использованием разных конфигураций, фактур и цветов. Благодаря этому межкомнатные двери ПВХ станут прекрасным решением для оформления дверных проемов в домах/квартирах и помогут подчеркнуть их интерьер. </h4><h4 style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(139, 113, 72);">Помимо привлекательного внешнего вида пластиковые межкомнатные двери имеют множество других достоинств.</h4><h4 style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(139, 113, 72);">Высокая тепло- и шумоизоляция. Эти характеристики выше, чем у деревянных и большинства металлических дверей.</h4><h4 style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(139, 113, 72);">Влагоустойчивость. Основные материалы, используемые при изготовлении пластиковых дверей, – пластик и алюминий. Оба они не подвержены действию влаги.</h4><h4 style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(139, 113, 72);">Экологичность. При производстве дверей используются безопасные материалы. Чтобы избежать пожелтения профильных конструкций вместо свинца (используемого на начальных этапах производства дверей) в смесь для отлива профиля добавляют стабилизатор на основе цинка и кальция.</h4><h4 style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(139, 113, 72);">Долговечность. Пластиковые двери имеют большой срок эксплуатации благодаря высокой устойчивости к механическим повреждениям, повышенной влажности и перепадам температур.</h4><h4 style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(139, 113, 72);">Практичность. Гладкая поверхность дверей легко очищается от грязи и пыли.</h4><h4 style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(139, 113, 72);">Разнообразие форм, цветов и фактур. Двери ПВХ могут быть прямоугольной, трапециевидной или арочной конфигурации. Их можно ламинировать, тонировать и декорировать шпросами.</h4><h4 style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(139, 113, 72);">Ценовая доступность. Пластиковые межкомнатные двери отличаются разумной стоимостью при имеющихся характеристиках.</h4><h4 style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: &quot;Fira Sans&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(139, 113, 72);">При заказе межкомнатных дверей ПВХ стоит обратить внимание на выбор качественного профиля и фурнитуры. К этим составляющим предъявляются меньшие требования по сравнению с конструкциями входных дверей, поскольку межкомнатные двери не подвержены действию атмосферных явлений и не нуждаются в надежных запирающих механизмах.</h4><br>',
